import React from 'react';
import { withRouter } from "react-router-dom";

class EndPage extends React.Component {

  redirect = () => {
    this.props.history.push('/step')
  }

  render() {
    return(
    <div className="container h-100 position-absolute">
        <div className="row align-items-center h-25">
            <div className="col-10 mx-auto text-center">
                <b>Calculate your personal Score</b><br/>
                Next we have a short 2â€“3 minute survey covering Diet, Home, Travel, and Other that will let us calculate your personal carbon footprint.
            </div>
        </div>
        <div className="row align-items-center fixed-bottom h-25">
            <div className="col-10 mx-auto text-center">
                <button onClick={this.redirect} type="button" className="btn btn-lg btn-block" style={{'background-color': '#48B07A', 'border-color': '#48B07A', 'color': '#fff', 'border-radius': '0'}}>Take the survey</button>
            </div>
        </div>
    </div>
    );}
}

export default withRouter(EndPage);
